import { useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import data from "./api";
import Questions from "./Questions";

function App() {



  const [show , setShow] = new useState();

  return (
    <div className="App bg-success text-center">
      <div className="card m-lg-5 ">
        <div class="card-header">React Interview Questions</div>

        <div class="card-body">

          { data.map( ( item )=>{

            const {id, q , a } = item;
            return <Questions
            key={id}
            questions={q}
            answers={a}
            ></Questions>
          })}
        </div>

      </div>
    </div>
  );
}
export default App;
